import {
  createBrowserRouter,
  RouterProvider,
  Route
}from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Home Page  !</div>,
  },
  {
    path: "/maker",
    element: <div>this is maker!</div>,
  },
  {
    path: "/customer",
    element: <div>this is customer!</div>,
  }
]);
function App() {
  return (
    <div>
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
